import React from "react";

const MaParoisse = () => {
  return (
    <div className="MaParoisse-container">
      <h1>Ma Paroisse</h1>

      <div className="MaParoisse-infos-container">
        <div className="MaParoisse-infos-left"></div>
        <div className="MaParoisse-infos-right"></div>
      </div>
    </div>
  );
};

export default MaParoisse;
